import React, { useState, useEffect } from "react";
import { Modal, Button, Form } from "react-bootstrap";

const TaskDialog = ({ show, handleClose, handleSave, taskData }) => {
  const [taskTitle, setTaskTitle] = useState("");
  const [description, setDescription] = useState("");
  const [deadline, setDeadline] = useState(new Date());
  const [radioValue, setRadioValue] = useState("Medium");
  const [errors, setErrors] = useState({});

  useEffect(() => {
    if (taskData) {
      setTaskTitle(taskData.title);
      setDescription(taskData.description);
      setDeadline(new Date(taskData.deadline));
      setRadioValue(taskData.priority);
    } else {
      setTaskTitle("");
      setDescription("");
      setDeadline(new Date());
      setRadioValue("Medium");
      setErrors({});
    }
  }, [taskData, show]);

  const validateForm = () => {
    let newErrors = {};
    if (!taskTitle.trim()) {
      newErrors.taskTitle = "Title is required";
    }
    if (!description.trim()) {
      newErrors.description = "Description is required";
    }
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = () => {
    if (validateForm()) {
      handleSave({
        title: taskTitle,
        description: description,
        deadline: deadline.toISOString().slice(0, 10),
        priority: radioValue,
      });
      handleClose();
    }
  };

  const inputStyle = {
    borderColor: "#dc3545",
    boxShadow: "0 0 0 0.2rem rgba(220, 53, 69, 0.25)",
  };

  return (
    <Modal show={show} onHide={handleClose} centered size="md">
      <Modal.Header
        closeButton
        style={{ backgroundColor: "#007bff", color: "white" }}
      >
        <Modal.Title>Add Task</Modal.Title>
      </Modal.Header>
      <Modal.Body style={{ backgroundColor: "white" }}>
        <Form>
          <Form.Group controlId="taskTitle">
            <Form.Control
              type="text"
              placeholder="Title"
              value={taskTitle}
              onChange={(e) => setTaskTitle(e.target.value)}
              style={errors.taskTitle ? inputStyle : {}}
            />
            {errors.taskTitle && (
              <Form.Text style={{ color: "#dc3545" }}>
                {errors.taskTitle}
              </Form.Text>
            )}
          </Form.Group>
          <Form.Group controlId="description">
            <Form.Control
              as="textarea"
              placeholder="Description"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              style={errors.description ? inputStyle : {}}
            />
            {errors.description && (
              <Form.Text style={{ color: "#dc3545" }}>
                {errors.description}
              </Form.Text>
            )}
          </Form.Group>
          <Form.Group controlId="deadline">
            <Form.Control
              type="date"
              value={deadline.toISOString().slice(0, 10)}
              onChange={(e) => setDeadline(new Date(e.target.value))}
            />
          </Form.Group>
          <Form.Group>
            <div key={`inline-radio`} className="mb-3">
              {["Low", "Med", "High"].map((priority) => (
                <Form.Check
                  inline
                  label={priority}
                  name="priorityOptions"
                  type="radio"
                  id={`priority${priority}`}
                  value={priority}
                  checked={radioValue === priority}
                  onChange={() => setRadioValue(priority)}
                  key={priority}
                  style={{
                    marginRight: "10px",
                    backgroundColor:
                      radioValue === priority ? "#007bff" : "#fff",
                    color: radioValue === priority ? "#fff" : "#000",
                    borderColor: "#007bff",
                    padding: "5px 10px",
                    borderRadius: "5px",
                  }}
                />
              ))}
            </div>
          </Form.Group>
        </Form>
      </Modal.Body>
      <Modal.Footer style={{ backgroundColor: "white" }}>
        <Button variant="outline-secondary" onClick={handleClose}>
          Cancel
        </Button>
        <Button variant="outline-primary" onClick={handleSubmit}>
          Add
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default TaskDialog;
